import React from 'react';
import './ServicesElevator.css'; // Make sure to import your CSS file

const ServicesElevator = () => {

    const services = [
        "Pixel Pushing",
        "Full-stack Engineering",
        "Cybersecurity",
        "QA Automation",
        "Front-end Engineering",
        "UI Engineering",
        "Hugo Programming",
        "Software Architecture",
        "React Development",
        "DevOps Engineering",
        "Technical Translation",
        "Software Consulting",
        "Demand Generation",
      ];

  return (
    <div className="services-elevator">
      <div className="elevator-inner">
        {Array.from({ length: 24 }, (_, index) => (
          <div className="text-line" key={index}>
            Line {services[((index % 12) + 1)]}: Your text here
          </div>
        ))}
      </div>
    </div>
  );
};

export default ServicesElevator;
